  "Allegations" : "Without admitting or denying the findings, Kochel consented to the sanction and to the entry of findings that she converted her member firm's funds by requesting and obtaining $23,847.24 in reimbursement from the firm for travel expenses, she did not incur. The findings stated that Kochel requested reimbursement for the trips through expense reports. For each trip, on each expense report, Kochel identified locations she claimed to have driven from and driven to, and identified amounts of personal car usage expenses she claimed to have incurred on those trips. These were fictitious trips, because she did not take such trips or incur such expenses. Kochel's supervisor provided her with his log-in credentials to the firm's expense reimbursement system so that she could approve the expense reimbursement requests of his team members. Without Kochel's supervisor's knowledge, she used his log-in credentials to approve the reimbursement of her fictitious expenses. Through her actions, Kochel obtained the funds that she was not entitled to receive.",
